import axios from 'axios';
import React, { useEffect, useState } from 'react';

const Vehicle = () => {
    const [data,setData]=useState();

    //Calling the Api 
    useEffect( async ()=>{
        try{
        let response = await axios.get('https://devapi.pikpart.com/api/vehicle/models');
        setData(response?.data?.data)

        }
        catch(err){
            <h1>{err}</h1>
        }
    },[])

    


    return (
        <>
            <div className="container text-center">
                <h3 className="text-primary">PikPart</h3>
            </div>
            <div className="card text-center" style={{width:"60%",marginLeft:"20%",marginRight:"20%"}}>
                <div className="header bg-primary">
                    <h5 className="text-light">Vehicle List</h5>
                </div>
                <div className="card-body">
                    <table className="table">
                        <thead>
                            <tr>
                                <td>Id</td>
                                <td>vehicle Brand</td>
                                <td>Name</td>
                                <td>Vehicle Type</td>
                            </tr>
                        </thead>
                    {data?.map((val)=>{
                        return (
                           <tbody>
                               <tr>
                                   <td>{val.id}</td>
                                   <td>{val.vehicleBrandId}</td>
                                   <td>{val.name}</td>
                                   <td>{val.vehicleType}</td>
                                   <button>Update</button>
                               </tr>
                              
                               </tbody>
                            
                        )
                    })}
                     </table>
                </div>
                </div>
            

        </>
    );
};

export default Vehicle;
